	  JS_Fast(iWind, next) {
	    var nextRate = this.iRate;
	    const wasmplayer = window[`wasmplayer-${this.szId}`];
	    if (next) {
	      switch (next) {
	        case 1:
	        case 2:
	        case 4:
	          nextRate = next;
	          break;
	        case 3:
	          nextRate = 0.5;
	          break;
	        default:
	          nextRate = this.iRate;
	          break;
	      }
	    } else {
	      switch (this.iRate) {
	        case 1:
	          nextRate = 2;
	          break;
	        case 2:
	          nextRate = 4;
	          break;
	        default:
	          nextRate = this.iRate;
	          break;
	      }
	    }
	    if (this.oStreamClient) this.oStreamClient.setPlayRate(this.szStreamUUID, nextRate);
	    this.iRate = nextRate;
	    console.log(",", nextRate);
	    if (nextRate == 4) {
	      // 44
	      let SetDecodeThreadNumRes = wasmplayer.JSPlayM4_SetDecodeThreadNum(4);
	      console.log("SetDecodeThreadNumRes", SetDecodeThreadNumRes);
	    }
	    let res = wasmplayer.JSPlayM4_Fast();
	    console.log("res", res);
	  }
	  JS_Slow() {
	    var nextRate = this.iRate;
	    switch (this.iRate) {
	      case 2:
	        nextRate = 1;
	        break;
	      case 4:
	        nextRate = 2;
	        break;
	      default:
	        nextRate = this.iRate;
	        break;
	    }
	    if (this.oStreamClient) this.oStreamClient.setPlayRate(this.szStreamUUID, nextRate);
	    this.iRate = nextRate;
	    console.log("", nextRate);
	  }
	  JS_Speed(nextRate) {
	    const wasmplayer = window[`wasmplayer-${this.szId}`];
	    if (this.oStreamClient) this.oStreamClient.setPlayRate(this.szStreamUUID, nextRate !== 3 ? nextRate : 0.5);
	    if (this.iRate === 3) {
	      if (nextRate === 1) {
	        // 0.5 -> 1
	        wasmplayer.JSPlayM4_Fast();
	      }
	      if (nextRate === 2) {
	        // 0.5 -> 2
	        wasmplayer.JSPlayM4_Fast();
	        wasmplayer.JSPlayM4_Fast();
	      }
	      if (nextRate === 4) {
	        // 0.5 -> 4
	        wasmplayer.JSPlayM4_Fast();
	        wasmplayer.JSPlayM4_Fast();
	        wasmplayer.JSPlayM4_Fast();
	      }
	    }
	    if (this.iRate === 1) {
	      if (nextRate === 3) {
	        // 1 -> 0.5
	        wasmplayer.JSPlayM4_Slow();
	      }
	      if (nextRate === 2) {
	        // 1 -> 2
	        wasmplayer.JSPlayM4_Fast();
	      }
	      if (nextRate === 4) {
	        // 1 -> 4
	        wasmplayer.JSPlayM4_Fast();
	        wasmplayer.JSPlayM4_Fast();
	      }
	    }
	    if (this.iRate === 2) {
	      if (nextRate === 1) {
	        // 2 -> 1
	        wasmplayer.JSPlayM4_Slow();
	      }
	      if (nextRate === 3) {
	        // 2 -> 0.5
	        wasmplayer.JSPlayM4_Slow();
	        wasmplayer.JSPlayM4_Slow();
	      }
	      if (nextRate === 4) {
	        // 2 -> 4
	        wasmplayer.JSPlayM4_Fast();
	      }
	    }
	    if (this.iRate === 4) {
	      if (nextRate === 1) {
	        // 4 -> 1
	        wasmplayer.JSPlayM4_Slow();
	        wasmplayer.JSPlayM4_Slow();
	      }
	      if (nextRate === 2) {
	        // 4 -> 2
	        wasmplayer.JSPlayM4_Slow();
	      }
	      if (nextRate === 3) {
	        // 4 -> 0.5
	        wasmplayer.JSPlayM4_Slow();
	        wasmplayer.JSPlayM4_Slow();
	        wasmplayer.JSPlayM4_Slow();
	      }
	    }
	    if (nextRate == 4) {
	      // 44
	      wasmplayer.JSPlayM4_SetDecodeThreadNum(4);
	    }
	    this.iRate = nextRate;
	    console.log("", nextRate);
	  }
